                <h3>{comb.nome}</h3>
            </div>
        combinacao.forEach((produto, index) => {
          if(index < combinacao.length - 3)
            console.log(produto)
        })
      })}

      {combinations.map((comb, index) => (
        <div className="combinacao" key={index}>
            <h3>{comb.nome}</h3>
        </div>
      ))}
    </div>
  );
}
